"use strict";(self.webpackChunkws2vs_github_io=self.webpackChunkws2vs_github_io||[]).push([[477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/2023/04/11/deploy-docusaurus-github-pages","metadata":{"permalink":"/blog/2023/04/11/deploy-docusaurus-github-pages","source":"@site/blog/2023-04-11-deploy-docusaurus-github-pages/index.md","title":"\u90e8\u7f72docusaurus\u5230\u81ea\u5df1\u7684github.io","description":"\u53c2\u8003\u5b98\u65b9\u7684\u6587\u7ae0\uff1ahttps://docusaurus.io/docs/deployment#triggering-deployment-with-github-actions","date":"2023-04-11T00:00:00.000Z","formattedDate":"April 11, 2023","tags":[],"readingTime":1.875,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"nextItem":{"title":"R4S \u8f6f\u8def\u7531 \u65c1\u8def\u7531","permalink":"/blog/2022/03/28/r4s-side-router"}},"content":"> \u53c2\u8003\u5b98\u65b9\u7684\u6587\u7ae0\uff1a[https://docusaurus.io/docs/deployment#triggering-deployment-with-github-actions](https://docusaurus.io/docs/deployment#triggering-deployment-with-github-actions)  \\n> \u6587\u6863\u548c\u64cd\u4f5c\u7684\u65e5\u671f: 2023-04-11\\n\\n## \u6b65\u9aa41 \u6dfb\u52a0ci\u6587\u4ef6\\n\\n\u5728\u9879\u76ee\u6839\u76ee\u5f55\u4e0b\u6dfb\u52a0\u76ee\u5f55`.github/workflows/`\uff0c\u4ee5\u53ca\u90e8\u7f72yml\u6587\u4ef6\uff0c\u5b98\u65b9\u7684`deploy.yml`\\n\\n## \u6b65\u9aa42 \u7a0d\u4f5c\u4fee\u6539\\n\\n1. \u4fee\u6539`on.push`\u7684`branches`\u8bbe\u7f6e\u4e3a\u4f60\u9700\u8981\u89e6\u53d1ci\u7684\u5206\u652f\uff0c\u6bd4\u5982`master`\uff08\u4e5f\u53ef\u4ee5\u662ftags\u7b49\u5176\u4ed6\u6761\u4ef6\uff09\\n2. [\u53ef\u9009] \u8bbe\u7f6enodejs\u7684\u7248\u672c\\n3. \u8bbe\u7f6e\u5305\u7ba1\u7406\uff0c\u8fd9\u91cc\u63a8\u8350`npm`\u548c`yarn`\uff0c\u4e14ci\u6267\u884c\u65f6\u9700\u8981\u6709\u5bf9\u5e94\u7684lock\u6587\u4ef6\uff0c\u5373`package-lock.json`\u6216`yarn.lock`\\n4. [\u53ef\u9009] \u8bbe\u7f6esteps\uff0c\u4e00\u822c\u5c31\u662f\u6ee1\u8db3`npm install`\u548c`npm run build`\u4e24\u4e2a\u5373\u53ef\\n5. \u5176\u4f59\u53ef\u4ee5\u4e0d\u52a8\uff0c\u4e5f\u53ef\u4ee5\u6309\u9700\u4fee\u6539\\n\\n## \u6b65\u9aa43 \u8bbe\u7f6ePages\\n\\n\u8bbe\u7f6e\u7684\u8def\u5f84\u5728`Settings` -> \u4fa7\u8fb9\u680f\u7684`Pages`\\n\\n\u9700\u8981\u8bbe\u7f6e\u5982\u4e0b\\n\\n:::info\\n`gh-pages`\u4f1a\u5728ci\u8dd1\u7684\u65f6\u5019\u81ea\u52a8\u521b\u5efa\uff0c\u4e5f\u53ef\u4ee5\u81ea\u5df1\u624b\u52a8\u65b0\u5efa\u3002\u5efa\u8bae\u63d0\u524d\u65b0\u5efa\u597d\u3002\\n:::\\n\\n1. `Build and deployment`\u4e0b\u7684`branch`\u4e3a`gh-pages`\\n2. \u6587\u4ef6\u76ee\u5f55\u4e3a`/(root)` \u4e5f\u5c31\u662f\u6839\u76ee\u5f55\\n\\n![](./imgs/Jietu_20230412000337.png)\\n\\n## \u6b65\u9aa44 \u68c0\u67e5\u548c\u6392\u969c\\n\\n1. \u5047\u8bbe\u8bbe\u7f6e\u7684\u89e6\u53d1\u65f6\u673a\u662f`on.push`\uff0c\u90a3\u4e48\u6bcf\u6b21\u63d0\u4ea4\u540e\uff0c\u4ed3\u5e93\u9996\u9875\u90fd\u4f1a\u6709\u4e2a\u221a\u6216\u8005\xd7\uff0c\u70b9\u5f00\u53ef\u4ee5\u770b\u5230\u5177\u4f53\u8dd1\u4e86\u90a3\u4e9b\\n2. \u5982\u679c\u6ca1\u6709\u81ea\u5df1\u5b9a\u4e49\u7684ci\uff08\u5b98\u65b9\u7684name\u53eb`Deploy to GitHub Pages`\uff09\uff0c\u90a3\u4e48\u53ef\u80fd\u662f\u6ca1\u6709\u6ee1\u8db3\u89e6\u53d1\u65f6\u673a\uff0c\u68c0\u67e5\u4f60\u7684\u5206\u652f\u662f\u5426\u6ee1\u8db3\u8981\u6c42\\n3. \u5982\u679c\u6709x\uff0c\u90a3\u4e48\u53ef\u4ee5\u67e5\u770b`details`\u505a\u8fd1\u4e00\u6b65\u6392\u67e5\uff08\u6bd4\u5982\u6211\u4f7f\u7528pnpm....)\\n4. job\u6267\u884c\u9700\u8981\u65f6\u95f4\\n\\n\\n![](./imgs/Jietu_20230412000308.png)"},{"id":"/2022/03/28/r4s-side-router","metadata":{"permalink":"/blog/2022/03/28/r4s-side-router","source":"@site/blog/2022-03-28-r4s-side-router/index.md","title":"R4S \u8f6f\u8def\u7531 \u65c1\u8def\u7531","description":"\u4f7f\u7528R4S\u4f5c\u4e3a\u4e00\u53f0\u8f6f\u8def\u7531\uff0c\u5b89\u88c5openWrt\u7cfb\u7edf\u3002\u5728\u7f51\u7edc\u62d3\u6251\u7ed3\u6784\u4e2d\uff0c\u4ee5\u65c1\u8def\u7531\u7684\u5f62\u5f0f\u5b58\u5728\uff0c\u6dfb\u52a0\u4e00\u4e9b\u7f51\u7edc\u529f\u80fd","date":"2022-03-28T00:00:00.000Z","formattedDate":"March 28, 2022","tags":[{"label":"\u7f51\u7edc","permalink":"/blog/tags/\u7f51\u7edc"}],"readingTime":2.825,"hasTruncateMarker":false,"authors":[],"frontMatter":{"tags":["\u7f51\u7edc"]},"prevItem":{"title":"\u90e8\u7f72docusaurus\u5230\u81ea\u5df1\u7684github.io","permalink":"/blog/2023/04/11/deploy-docusaurus-github-pages"}},"content":"\u4f7f\u7528R4S\u4f5c\u4e3a\u4e00\u53f0\u8f6f\u8def\u7531\uff0c\u5b89\u88c5openWrt\u7cfb\u7edf\u3002\u5728\u7f51\u7edc\u62d3\u6251\u7ed3\u6784\u4e2d\uff0c\u4ee5\u65c1\u8def\u7531\u7684\u5f62\u5f0f\u5b58\u5728\uff0c\u6dfb\u52a0\u4e00\u4e9b\u7f51\u7edc\u529f\u80fd\\n\\n## R4S\\n\\n\u51c6\u5907\u7684\u4e1c\u897f\u6709\u5982\u4e0b\\n\\n- R4S\u4e00\u53f0\\n- R4S\u7684\u7535\u6e90\\n- TF\u5361\\n- TF\u5361\u8bfb\u5361\u5668\\n\\n## 1\u3001\u4e0b\u8f7dopenWrt\u955c\u50cf\\n\\n\u955c\u50cf\u9009\u7528[SuLingGG](https://github.com/SuLingGG)\u7684\uff0c\u53c2\u8003[github\u6587\u6863](https://github.com/SuLingGG/OpenWrt-Rpi)\uff0c\u9009\u62e9\u9002\u5408R4S\u7684openWrt\u955c\u50cf\u3002\\n\\n\u6709\u4ee5\u4e0b\u51e0\u70b9\u6ce8\u610f\u4e00\u4e0b\\n\\n- \u6587\u4ef6\u683c\u5f0f\u9009`ext4`\uff0c\u4e3a\u4e86\u6709\u826f\u597d\u7684`linux`\u4f53\u9a8c\\n- `systemupgrade`\u8fd8\u662f`factory`\uff0c\u4e00\u822c\u9009\u524d\u7f6e\\n\\n## 2\u3001\u5199\u76d8\\n\\n\u5148\u4e0b\u8f7d\u5199\u76d8\u8f6f\u4ef6[rufus](https://rufus.ie/zh/)\\n\\n:::caution \u6ce8\u610f\\n\u5173\u95edR4S\u7684\u7535\u6e90\uff0c\u518d\u62d4\u51faTF\u5361\uff0c**\u6ce8\u610f\uff1aTF\u5361\u4e0d\u80fd\u70ed\u63d2\u62d4\uff01\uff01\uff01** \uff08\u7b2c\u4e00\u6b21\u8bf7\u5ffd\u7565\uff09\\n\\n\u76f4\u63a5\u6309\u7167\u8f6f\u4ef6\u63d0\u793a\u7684\u8fdb\u884c\u5199\u76d8\u64cd\u4f5c\uff0c**\u6ce8\u610f\uff1a\u4e0d\u8981\u4f7f\u7528windows\u7cfb\u7edf\u7684\u683c\u5f0f\u5316\u63d0\u793a\u683c\u5f0f\u5316TF\uff0c\u76f4\u63a5\u5199\u5373\u53ef**\\n:::\\n\\n## 3\u3001\u5b89\u88c5\u7cfb\u7edf\\n\\n\u8bf7\u4e25\u683c\u6309\u7167\u987a\u5e8f\\n\\n- `step1` \u5173\u95edR4S\u7684\u7535\u6e90\uff0c\u62d4\u6389\u4e00\u5207\u7ebf\u6750\u3002\\n- `step2` \u5c06\u4e00\u4e2a\u7f51\u7edc\uff0c\u8fde\u63a5R4S\u7684`LAN`\u53e3\uff0c\u4ee5\u53ca\u4e00\u53f0`PC`\u7684`WAN`\u53e3\u3002\u8fd9\u5c06\u7ec4\u6210\u4e00\u4e2a\u5c40\u57df\u7f51\\n- `step3` \u901a\u8fc7`PC`\u8f93\u5165R4S\u7684ip\u5730\u5740\uff0c\u8fd9\u4e00\u822c\u662f\u7531\u955c\u50cf\u63d0\u4f9b\u8005\u6307\u5b9a\u7684\u4e00\u4e2a\u56fa\u5b9a\u7684\u5730\u5740\u3002\u6bd4\u5982\u4e0a\u9762\u63d0\u4f9b\u7684\u955c\u50cf\u4e00\u822c\u662f`192.168.1.1`\\n  - \u5982\u679c`step2`\u5c06R4S\u548c\u8def\u7531\u5668\u76f4\u63a5\u8fde\u4e0a\u7684\u8bdd\uff0c\u90a3\u4e48R4S\u7684ip\u5730\u5740\u53ef\u80fd\u4f1a\u88abDHCP\u6240\u5206\u914d\uff0c\u4ece\u800c\u8fdb\u4e0d\u4e86\u540e\u53f0\u7cfb\u7edf\\n- `step4` \u786e\u8ba4\u7cfb\u7edf\u65e0\u8bef\u540e\u8fdb\u884c\u4e0b\u4e00\u6b65\\n\\n## 4\u3001\u65c1\u8def\u7531\u8bbe\u7f6e\\n\\n\u65c1\u8def\u7531\u662f\u975e\u4fb5\u5165\u5f0f\u7684\u8f6f\u8def\u7531\u8bbe\u7f6e\u65b9\u5f0f\u3002\u548c\u4e3b\u8def\u7531\u662f\u89e3\u8026\u7684\uff0c\u4f5c\u4e3a\u4e00\u4e2a\u9644\u52a0\u529f\u80fd\u9644\u7740\u5728\u539f\u6709\u7684\u7f51\u7edc\u62d3\u6251\u7ed3\u6784\u4e2d\u3002\\n\\n### 4.1\u3001\u8bbe\u7f6eopenWrt\u7cfb\u7edf\u4e2d\u7684LAN\\n\\n:::caution \u6ce8\u610f\\n\u8bf7\u5148\u70b9\u4fdd\u5b58\uff0c\u4e0d\u8981\u70b9\u4fdd\u5b58&\u5e94\u7528\\n:::\\n\\n#### 4.1.1\u3001\u8bbe\u7f6e\u8f6f\u8def\u7531\u7684\u9759\u6001IP\u5730\u5740\uff0c\u5e76\u5c06\u6570\u636e\u5305\u8f6c\u53d1\u4f1a\u4e3b\u8def\u7531\\n\\n![\u56fe1](./imgs/0zm6s120009dx3ye19664.png)\\n\\n#### 4.1.2\u3001\u5173\u95edIPV6\\n\\n![\u56fe2](./imgs/Jietu20220328-203935@2x.png)\\n![\u56fe3](./imgs/Jietu20220328-204011@2x.png)\\n\\n#### 4.1.3\u3001\u5173\u95edLAN\u53e3\u7684DHCP\uff0c\u5c06DHCP\u7684\u804c\u8d23\u4ea4\u7ed9\u4e3b\u8def\u7531\\n\\n![\u56fe4](./imgs/Jietu20220328-203824@2x.png)\\n\\n### 4.2\u3001\u9632\u706b\u5899\u914d\u7f6e\\n\\n\u4e24\u70b9\\n\\n- 1\u3001\u5173\u95ed` SYN-flood \u9632\u5fa1 `\\n- 2\u3001\u5f00\u542f `IP \u52a8\u6001\u4f2a\u88c5`\\n\\n![\u56fe5](./imgs/Jietu20220328-204541@2x.png)\\n\\n## 5\u3001\u4f7f\u7528\\n\\n\u9700\u8981\u4f7f\u7528\u7684\u7aef\uff08PC\u3001\u624b\u673a\u3001PS5\u7b49\uff09\\n\\n- \u8bbe\u7f6eip\uff0c\u968f\u610f\u6311\u9009\u5373\u53ef\\n- \u56fa\u5b9a\u7f51\u5173\u4e3a`255.255.255.0`\\n- \u8def\u7531\u5668\u6216\u8005\u670d\u52a1\u5668\u9009`[\u8f6f\u8def\u7531\u7684ip]`\\n- dns\u670d\u52a1\u5668\u9009`[\u8f6f\u8def\u7531\u7684ip]`"}]}')}}]);